import React, { Component } from 'react';
import { Header, Content } from './components/header/header'
import './App.css';

class App extends Component {

  render(){
   let i = 0;
   setTimeout(() => {
      i = i + 1
   }, 500);
    return(
       <div>
          <h1>Hello World</h1>
          <p data-myattribute = "somevalue">{i+1}</p>
          <Header></Header>
          <Content text="Paragraph"></Content>
       </div>
    );
 }
}

export default App;
